import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Recommendation from './Recommendation';
import Saved from './Saved';

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Recommendation />} />
                <Route path="/saved" element={<Saved />} />
            </Routes>
        </Router>
    );
}

export default App;
